import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

class App extends React.Component {
  render(){
    return(
      <div>
       <ul class="nav justify-content-center">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">
          <img src="./logo.png" alt="Logo" width="250" height="244" class="d-aline-block align-text-inline"/>
            Home</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Weekends</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Summer 2022</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">About us</a>
        </li>
      </ul>
    </div>

    )
  }
}

export default App;
